import React, { useState } from 'react';
import { supabase } from '../supabase';
import VolunteerManagement from '../components/VolunteerManagement';

export default function DashboardPage() {
  const [activeTab, setActiveTab] = useState('overview');

  const handleSignOut = async () => {
    const { error } = await supabase.auth.signOut();
    if (error) {
      alert(`Sign Out Failed: ${error.message}`);
    }
    // The onAuthStateChange listener in App.js will handle the redirect
  };

  const renderContent = () => {
    switch (activeTab) {
      case 'volunteers':
        return <VolunteerManagement />;
      case 'requests':
        return <RequestManagement />;
      case 'analytics':
        return <Analytics />;
      default:
        return <Overview />;
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.header}>
        <h1 style={styles.title}>BandhuConnect+ Admin</h1>
        <button onClick={handleSignOut} style={styles.signOutButton}>
          Sign Out
        </button>
      </div>

      <div style={styles.navigation}>
        <button 
          onClick={() => setActiveTab('overview')}
          style={activeTab === 'overview' ? styles.activeNavButton : styles.navButton}
        >
          üìä Overview
        </button>
        <button 
          onClick={() => setActiveTab('volunteers')}
          style={activeTab === 'volunteers' ? styles.activeNavButton : styles.navButton}
        >
          üë• Volunteers
        </button>
        <button 
          onClick={() => setActiveTab('requests')}
          style={activeTab === 'requests' ? styles.activeNavButton : styles.navButton}
        >
          üìã Requests
        </button>
        <button 
          onClick={() => setActiveTab('analytics')}
          style={activeTab === 'analytics' ? styles.activeNavButton : styles.navButton}
        >
          üìà Analytics
        </button>
      </div>

      <div style={styles.content}>
        {renderContent()}
      </div>
    </div>
  );
}

// Overview Component
function Overview() {
  const [stats, setStats] = React.useState({
    activeVolunteers: 0,
    inactiveVolunteers: 0,
    onDutyVolunteers: 0,
    offDutyVolunteers: 0,
    activeRequests: 0,
    resolvedToday: 0
  });

  React.useEffect(() => {
    fetchStats();
  }, []);

  const fetchStats = async () => {
    try {
      // Get active volunteers count
      const { count: activeCount } = await supabase
        .from('profiles')
        .select('*', { count: 'exact', head: true })
        .eq('role', 'volunteer')
        .eq('volunteer_status', 'active');

      // Get inactive volunteers count
      const { count: inactiveCount } = await supabase
        .from('profiles')
        .select('*', { count: 'exact', head: true })
        .eq('role', 'volunteer')
        .eq('volunteer_status', 'inactive');

      // Get on duty volunteers count
      const { count: onDutyCount } = await supabase
        .from('profiles')
        .select('*', { count: 'exact', head: true })
        .eq('role', 'volunteer')
        .eq('duty_status', 'on_duty');

      // Get off duty volunteers count
      const { count: offDutyCount } = await supabase
        .from('profiles')
        .select('*', { count: 'exact', head: true })
        .eq('role', 'volunteer')
        .eq('duty_status', 'off_duty');

      setStats(prev => ({
        ...prev,
        activeVolunteers: activeCount || 0,
        inactiveVolunteers: inactiveCount || 0,
        onDutyVolunteers: onDutyCount || 0,
        offDutyVolunteers: offDutyCount || 0
      }));
    } catch (error) {
      console.error('Error fetching stats:', error);
    }
  };

  return (
    <div style={styles.overviewContainer}>
      <h2 style={styles.sectionTitle}>Dashboard Overview</h2>
      <div style={styles.statsGrid}>
        <div style={styles.statCard}>
          <h3>Active Volunteers</h3>
          <p style={styles.statNumber}>{stats.activeVolunteers}</p>
          <p style={styles.statSubtext}>Currently active</p>
        </div>
        <div style={styles.statCard}>
          <h3>Inactive Volunteers</h3>
          <p style={styles.statNumber}>{stats.inactiveVolunteers}</p>
          <p style={styles.statSubtext}>Not active</p>
        </div>
        <div style={styles.statCard}>
          <h3>On Duty</h3>
          <p style={styles.statNumber}>{stats.onDutyVolunteers}</p>
          <p style={styles.statSubtext}>Currently working</p>
        </div>
        <div style={styles.statCard}>
          <h3>Off Duty</h3>
          <p style={styles.statNumber}>{stats.offDutyVolunteers}</p>
          <p style={styles.statSubtext}>Available volunteers</p>
        </div>
      </div>

      <div style={styles.quickActions}>
        <h3 style={styles.sectionTitle}>Quick Actions</h3>
        <div style={styles.actionButtons}>
          <button style={styles.actionButton}>
            üë• Add Volunteer
          </button>
          <button style={styles.actionButton}>
            üìã View All Requests
          </button>
          <button style={styles.actionButton}>
            üìä Generate Report
          </button>
          <button style={styles.actionButton}>
            ‚öôÔ∏è System Settings
          </button>
        </div>
      </div>

      <div style={styles.recentActivity}>
        <h3 style={styles.sectionTitle}>Recent Activity</h3>
        <div style={styles.activityList}>
